function toggleOnAnimatePlot(t){return t.animate=!0,t}function toggleOffAnimatePlot(t){return t.animate=!1,t}function addCursor(t){return t.cursor={show:!0,zoom:!0},t}function addHighlighting(t){return t.highlighter={sizeAdjust:5,tooltipLocation:"n",tooltipFormatString:"%.2f"},t}function setTitle(t,n){return t.title=n,t}function createPlot(t,n,o){return $.jqplot(t,n,o)}